script: |
  super -f text -I q772.spq | sort > q772.out

inputs:
  - name: q772.spq
    data: |
      SELECT DISTINCT - cor1.col1 + - 21 * + 94 AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q772.out
    data: |
      -1991
      -2005
      -2033
